  <style>
    @import url("https://fonts.googleapis.com/css?family=Roboto:300,400,700,400i&subset=cyrillic");

    @keyframes pump {
      0% {
        transform: translateY(0)
      }

      25% {
        transform: translateY(-5px)
      }

      75% {
        transform: translateY(5px)
      }

      to {
        transform: translateY(0)
      }
    }

    body,
    html {
      height: 100%;
      margin: 0;
      padding: 0
    }

    body {
      background-color: #000;
      color: #fff;
      font: 20px/1.35 Roboto, sans-serif;
      font-weight: 400
    }

    * {
      box-sizing: border-box
    }

    .wrapper {
      background: url(/lands/20/girls.jpg) no-repeat 50% 50%;
      background-size: cover;
      height: 100%;
      padding-bottom: 100px;
      position: relative;
      text-align: center
    }

    .wrapper:before {
      background: rgba(0, 0, 0, .65);
      content: "";
      display: block;
      height: 100%;
      left: 0;
      position: absolute;
      top: 0;
      width: 100%
    }

    .cntr-block {
      font-size: 36px;
      left: 50%;
      position: absolute;
      top: 50%;
      transform: translate(-50%, -50%)
    }

    .txt_big {
      border-bottom: 10px solid red;
      display: inline-block;
      font-size: 72px;
      font-weight: 700;
      margin-bottom: 10px
    }

    iframe {
      display: none
    }

    .layout {
      color: #fff;
      display: block;
      height: 100%;
      left: 0;
      position: fixed;
      top: 0;
      width: 100%;
      z-index: 1100
    }

    .layout__arrow {
      animation: pump .75s ease-out 0s infinite;
      background: url(/lands/20/arrow.png) no-repeat 50% 50%;
      display: block;
      height: 135px;
      margin: 0 auto 50px;
      width: 114px
    }

    .layout__text {
      display: block;
      font-family: sans-serif;
      font-size: 24px;
      left: 165px;
      max-width: 350px;
      position: absolute;
      text-align: center;
      top: 165px;
      transform: translateX(-50%)
    }

    .Chrome {
      left: 380px;
      top: 145px
    }

    .Firefox {
      left: 365px;
      top: 140px
    }

    .Opera {
      left: 380px;
      top: 125px
    }

    .Yandex {
      left: auto;
      right: 210px;
      top: 190px;
      transform: translateX(50%)
    }

    html[lang=de] .Chrome,
    html[lang=es] .Chrome,
    html[lang=fr] .Chrome,
    html[lang=ru] .Chrome {
      left: 280px
    }

    html .modal .layout__text {
      left: 420px;
      right: auto;
      top: 165px;
      transform: translateX(-50%)
    }

    html[lang=de] .modal .layout__text,
    html[lang=es] .modal .layout__text,
    html[lang=fr] .modal .layout__text,
    html[lang=ru] .modal .layout__text {
      left: 350px
    }

    html[lang=ar],
    html[lang=fa] {
      direction: rtl
    }

    html[lang=ar] .layout__text,
    html[lang=fa] .layout__text {
      left: auto;
      right: 300px;
      transform: translateX(50%)
    }

    @media (max-width:768px) {
      .cntr-block {
        font-size: 20px;
        width: 80%
      }

      .txt_big {
        font-size: 36px
      }

      .layout__arrow {
        display: none
      }

      .layout__text {
        display: none;
        left: 50%;
        top: 77%;
        transform: translateX(-50%)
      }
    }

    @media (max-width:414px) {
      .layout__text {
        font-size: 16px;
        line-height: 24px
      }

      .layout__text hr {
        display: none
      }
    }
  </style>
